// src/pages/Profile.js
import React from 'react';
import st from './HomePage.module.css';

const HomePage = () => {
  return (
    <div className="profile-page">
      <h2>Главная</h2>
      <p>Рады снова видеть тебя!</p>
      <p>Скоро тут будет полноценный раздел</p>
    </div>
  );
};

export default HomePage;
